uageCode\":\"yo\",\"languageName\":{\"simpleText\":\"Yoruba\"}},{\"languageCode\":\"zu\",\"languageName\":{\"simpleText\":\"Zulu\"}}],\"defaultAudioTrackIndex\":0}},\"videoDetails\":{\"videoId\":\"RfuDH-ScViQ\",\"title\":\"Minnie's Bow-Toons - Cuckoo-Loca's Egg-celent Adventure\",\"lengthSeconds\":\"189\",\"keywords\":[\"captain\",\"Minnie Mouse\",\"doc mcstuffins\",\"World\",\"handy\",\"special\",\"NeverLand\",\"princess\",\"bow-toons\",\"Disneyland\",\"disney\",\"Daisy Duck\",\"Walt Disney\",\"doc\",\"minnie\",\"Mbt\",\"walt\",\"club\",\"manny\",\"mouse\",\"Pirate\",\"agent\",\"hook\",\"junior\",\"house\",\"Mickey Mouse\",\"mickey\"],\"channelId\":\"UC7Gf2tZ8coTX2ckTPgn62iQ\",\"isOwnerViewing\":false,\"shortDescription\":\"Minnie and Daisy find an Egg outside the Bow-Tique! Cuckoo-Loca has to look after, how will she handle an egg bigger than her?\\n\\nFor more fun and games from all of your favourite shows, head over to: \\nhttp:\/\/www.disneyjunior.co.uk\/\\n\\nWant more updates and exclusive goodies? Like our Facebook page:\\nhttp:\/\/www.facebook.com\/DisneyJuniorUK\\n\\nMINNIES BOW-TOONS\\n\\nMinnie Mouse and her best friend Daisy Duck are showing their love of all things fashion by opening up their very own special shop, Minnies Bow-Tique! Minnies Bow-Toons is a sweet spin off Disney Jr series from Mickey Mouse Clubhouse following friends Minnie and Daisy as they learn what its like to run their very own shop!\\n\\nAccompanied by Figaro the friendly kitten, Minnies trouble-making nieces, Millie and Melody and a cute little cuckoo called Coca Loca, Minnies Bow-Tique is always bustling with exciting and fun new customers and stories!\\n\\nSo if youre looking for a pretty new bow for your hair or a smart bow-tie to sharpen up your look, theres only one shop for you! Head down to Minnies Bow-Tique and catch up with Minnie Mouse and Daisy Duck in the fun and most fashionable, Minnies Bow-Toons!\\n\\nMINNIE MOUSE\\nWith her smart dress sense, matching hair bows and love of polka dots, the sweet and kind Minnie Mouse finally realises her dream of opening up her very own shop with her best friend Daisy Duck! Minnies Bow-Tique is open for business! \\n\\nDAISY DUCK\\nDaisy Duck is the talkative, caring and fashion-loving best friend of Minnie Mouse. She loves everything to do with clothes and fashion so working in Minnies Bow-Tique with her very best friend is a dream come true!\\n\\nCLARABELLE COW\\nClarabelle is the fun-loving best friend of Minnie Mouse and Daisy Duck. She is often on hand to help her friends in the shop when they need it.\\n\\nFIGARO\\nFigaro is Minnie Mouses cat and close friend who likes to help her in the shop. Figaro is a curious, mischievous little cat who loves to have adventures. But despite his curious nature and love of exploring, his favourite thing to do is curling up in Minnies Bow-Tique and having a nice long nap!\\n\\n\\nCUCKOO LOCA\\nCuckoo Loca is Minnie Mouse and Daisy Ducks cute little cuckoo bird friend who lives inside a cuckoo clock in Minnies Bow-Tique. She loves to pop out of her clock and see what is happening in the shop, helping her friends whenever she can.\\n\\nMILLIE AND MELODY MOUSE\\nMillie and Melody are Minnie Mouses cheeky little twin nieces who are often up to mischief, causing trouble for Minnie Mouse and her friends.\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/RfuDH-ScViQ\/hqdefault.jpg?sqp=-oaymwEYCKgBEF5IVfKriqkDCwgBFQAAiEIYAXAB\\u0026rs=AOn4CLAoUj9MyhUzB9WOF-3kh5i_ZRmWRA\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/RfuDH-ScViQ\/hqdefault.jpg?sqp=-oaymwEYCMQBEG5IVfKriqkDCwgBFQAAiEIYAXAB\\u0026rs=AOn4CLA5zY_H0hUxCE_h5CalX75qwKk1fQ\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/RfuDH-ScViQ\/hqdefault.jpg?sqp=-oaymwEZCPYBEIoBSFXyq4qpAwsIARUAAIhCGAFwAQ==\\u0026rs=AOn4CLC4H3htcrmTYDYooQdu2pWF8cFseg\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/RfuDH-ScViQ\/  \n\nDAISY DUCK\nDaisy Duck is the talkative, caring and fashion-loving best friend of Minnie Mouse. She loves everything to do with clothes and fashion so working in Minnies Bow-Tique with her very best friend is a dream come true!\n\nCLARABELLE COW\nClarabelle is the fun-loving best friend of Minnie Mouse and Daisy Duck. She is often on hand to help her friends in the shop when they need it.\n\nFIGARO\nFigaro is Minnie Mouses cat and close friend who likes to help her in the shop. Figaro is a curious, mischievous little cat who loves to have adventures. But despite his curious nature and love of exploring, his favourite thing to do is curling up in Minnies Bow-Tique and having a nice long nap!\n\n\nCUCKOO LOCA\nCuckoo Loca is Minnie Mouse and Daisy Ducks cute little cuckoo bird friend who lives inside a cuckoo clock in Minnies Bow-Tique. She loves to pop out of her clock and see what is happening in the shop, helping her friends whenever she can.\n\nMILLIE AND MELODY MOUSE\nMillie and Melody are Minnie Mouses cheeky little twin nieces who are often up to mischief, causing trouble for Minnie Mouse and her friends."}]},"subscribeButton":{"subscribeButtonRenderer":{"buttonText":{"runs":[{"text":"Subscribe"}]},"subscriberCountText":{"simpleText":"7.3M"},"subscribed":false,"enabled":true,"type":"FREE","channelId":"UC7Gf2tZ8coTX2ckTPgn62iQ","showPreferences":false,"subscriberCountWithSubscribeText":{"simpleText":"7.3M"},"subscribedButtonText":{"runs":[{"text":"Subscribed"}]},"unsubscribedButtonText":{"runs":[{"text":"Subscribe"}]},"trackingParams":"CIYBEJsrIhMIvdnS8MeQ6AIVhdBRCh0AAwRMMgV3YXRjaA==","unsubscribeButtonText":{"runs":[{"text":"Unsubscribe"}]},"longSubscriberCountText":{"runs":[{"text":"7.3M subscribers"}]},"shortSubscriberCountText":{"simpleText":"7.3M"},"subscribeAccessibility":{"accessibilityData":{"label":"Subscribe to DisneyJuniorUK."}},"unsubscribeAccessibility":{"accessibilityData":{"label":"Unsubscribe from DisneyJuniorUK."}},"notificationPreferenceBu innies Bow-Toons!\n\nMINNIE MOUSE\nWith her smart dress sense, matching hair bows and love of polka dots, the sweet and kind Minnie Mouse finally realises her dream of opening up her very own shop with her best friend Daisy Duck! Minnies Bow-Tique is open for business! \n\nDAISY DUCK\nDaisy Duck is the talkative, caring and fashion-loving best friend of Minnie Mouse. She loves everything to do with clothes and fashion so working in Minnies Bow-Tique with her very best friend is a dream come true!\n\nCLARABELLE COW\nClarabelle is the fun-loving best friend of Minnie Mouse and Daisy Duck. She is often on hand to help her friends in the shop when they need it.\n\nFIGARO\nFigaro is Minnie Mouses cat and close friend who likes to help her in the shop. Figaro is a curious, mischievous little cat who loves to have adventures. But despite his curious nature and love of exploring, his favourite thing to do is curling up in Minnies Bow-Tique and having a nice long nap!\n\n\nCUCKOO LOCA\nCuckoo Loca is Minnie Mouse and Daisy Ducks cute little cuckoo bird friend who lives inside a cuckoo clock in Minnies Bow-Tique. She loves to pop out of her clock and see what is happening in the shop, helping her friends whenever she can.\n\nMILLIE AND MELODY MOUSE\nMillie and Melody are Minnie Mouses cheeky little twin nieces who are often up to mischief, causing trouble for Minnie Mouse and her friends.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/RfuDH-ScViQ/hqdefault.jpg?sqp=-oaymwEYCKgBEF5IVfKriqkDCwgBFQAAiEIYAXAB\u0026rs=AOn4CLAoUj9MyhUzB9WOF-3kh5i_ZRmWRA","width":168,"height":94},{"url":"https://i.ytimg.com/vi/RfuDH-ScViQ/hqdefault.jpg?sqp=-oaymwEYCMQBEG5IVfKriqkDCwgBFQAAiEIYAXAB\u0026rs=AOn4CLA5zY_H0hUxCE_h5CalX75qwKk1fQ","width":196,"height":110},{"url":"https://i.ytimg.com/vi/RfuDH-ScViQ/hqdefault.jpg?sqp=-oaymwEZCPYBEIoBSFXyq4qpAwsIARUAAIhCGAFwAQ==\u0026rs=AOn4CLC4H3htcrmTYDYooQdu2pWF8cFseg","width":246,"height":138},{"url":"https://i.ytimg.com/vi/R howing their love of all things fashion by opening up their very own special shop, Minnies Bow-Tique! Minnies Bow-Toons is a sweet spin off Disney Jr series from Mickey Mouse Clubhouse following friends Minnie and Daisy as they learn what its like to run their very own shop!\n\nAccompanied by Figaro the friendly kitten, Minnies trouble-making nieces, Millie and Melody and a cute little cuckoo called Coca Loca, Minnies Bow-Tique is always bustling with exciting and fun new customers and stories!\n\nSo if youre looking for a pretty new bow for your hair or a smart bow-tie to sharpen up your look, theres only one shop for you! Head down to Minnies Bow-Tique and catch up with Minnie Mouse and Daisy Duck in the fun and most fashionable, Minnies Bow-Toons!\n\nMINNIE MOUSE\nWith her smart dress sense, matching hair bows and love of polka dots, the sweet and kind Minnie Mouse finally realises her dream of opening up her very own shop with her best friend Daisy Duck! Minnies Bow-Tique is open for business! \n\nDAISY DUCK\nDaisy Duck is the talkative, caring and fashion-loving best friend of Minnie Mouse. She loves everything to do with clothes and fashion so working in Minnies Bow-Tique with her very best friend is a dream come true!\n\nCLARABELLE COW\nClarabelle is the fun-loving best friend of Minnie Mouse and Daisy Duck. She is often on hand to help her friends in the shop when they need it.\n\nFIGARO\nFigaro is Minnie Mouses cat and close friend who likes to help her in the shop. Figaro is a curious, mischievous little cat who loves to have adventures. But despite his curious nature and love of exploring, his favourite thing to do is curling up in Minnies Bow-Tique and having a nice long nap!\n\n\nCUCKOO LOCA\nCuckoo Loca is Minnie Mouse and Daisy Ducks cute little cuckoo bird friend who lives inside a cuckoo clock in Minnies Bow-Tique. She loves to pop out of her clock and see what is happening in the shop, helping her friends whenever she can.\n\nMILLIE AND MELODY MOUSE\nMillie and Melody are Minnie Mouses cheeky little twin nieces who are often up to mischief, causing trouble for Minnie Mouse and her friends."},"lengthSeconds":"189","ownerProfileUrl":"http://www.youtube.com/user/DisneyJuniorUK","ownerGplusProfileUrl":"https://plus.google.com/106820598927098271865","externalChannelId":"UC7Gf2tZ8coTX2ckTPgn62iQ","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO","MP","MQ","MR","MS","MT","MU","MV","MW","MX","MY","MZ","NA","NC","NE","NF","NG","NI","NL","NO","NP","NR","NU","NZ","OM","PA","PE","PF","PG","PH","PK","PL","PM","PN","PR","PS","PT","PW","PY","QA","RE","RO","RS","RU","RW","SA","SB","SC","SD","SE","SG","SH","SI","SJ","SK","SL","SM","SN","SO","SR","SS","ST","SV","SX","SY","SZ","TC","TD","TF","TG","TH","TJ","TK","TL","TM","TN","TO","TR","TT","TV","TW","TZ","UA","UG","UM","US","UY","UZ","VA","VC","VE","VG","VI","VN","VU","WF","WS","YE","YT","ZA","ZM","ZW"],"isUnlisted":false,"hasYpcMetadata":false,"viewCount":"10962241","category":"Entertainment","publishDate":"2013-04-06","ownerChannelName":"DisneyJuniorUK","uploadDate":"2013-04-06"}},"trackingParams":"CAAQu2kiEwiqx9Lwx5DoAhUBwlEKHUIWAWM=","attestation":{"playerAttestationRenderer":{"challenge":"a=5\u0026a2=1\u0026b=xobQJdKJ9E2Pzk2s7facmF1mhMk\u0026c=1583865795
